import Header from './Header';

const Layout = props => (
  <div id="layout">
    <Header />
    {props.children}
			<style jsx global>{`
				body {
					font-size: 14pt;
					position: relative;
					width: 100%;
					min-height: 100%;
					padding: 0;
					margin: 0;
					color: whitesmoke;
					font-family: 'Cutive Mono', monospace;
					line-height: 1.5em;
					background-color: #202020;
				}
			`}</style>
  </div>
);

export default Layout;
